import React, { useState } from "react";

const AddNew = () => {
  const [name, setName] = useState("");
  const [status, setStatus] = useState("");
  const [DA, setDA] = useState("");
  const [DR, setDR] = useState("");
  const [URL, setURL] = useState("");
  const [quantity, setQuantity] = useState("");
  const [linkA, setLinkA] = useState("");
  const [linkB, setLinkB] = useState("");
  const [linkC, setLinkC] = useState("");
  const [linkD, setLinkD] = useState("");
  const [linkE, setLinkE] = useState("");
  const [linkF, setLinkF] = useState("");
  const [linkG, setLinkG] = useState("");
  const [linkH, setLinkH] = useState("");
  const [linkI, setLinkI] = useState("");
  const [linkJ, setLinkJ] = useState("");
  const [domainComments, setDomainComments] = useState("");
  const [linkType, setLinkType] = useState("");
  const [linkAttribute, setLinkAttribute] = useState("");
  const [refDomains, setRefDomains] = useState("");
  const [industry, setIndustry] = useState("");
  const [trafficCountry, settrafficCountry] = useState("");
  const [semrush, setSemrush] = useState("");
  const [ahref, setAhref] = useState("");
  const [currency, setCurrency] = useState("");
  const [original, setOriginal] = useState("");
  const [negotiated, setNegotiated] = useState("");
  const [officeCountry, setOfficeCountry] = useState("");
  const [costComments, setCostComments] = useState("");
  const [contactDetailsName, setContactDetailsName] = useState("");
  const [contactEmailA, setContactEmailA] = useState("");
  const [contactEmailB, setContactEmailB] = useState("");
  const [contactEmailC, setContactEmailC] = useState("");
  const [contactPhone, setContactPhone] = useState("");

  return (
    <div>
      {/* {console.log(name)} */}
      <h2 id="domain">Domain Details</h2>
      <div style={{}}>
        <p style={{ fontWeight: "bold" }}>NAME</p>
        <input
          style={{
            border: "1px solid grey",
            padding: "5px",
            borderRadius: "5px",
            marginBottom: "5px",
            width: "100%",
          }}
        />
        <p style={{ fontWeight: "bold" }}>STATUS</p>
        <input
          style={{
            border: "1px solid grey",
            padding: "5px",
            borderRadius: "5px",
            marginBottom: "5px",
            width: "100%",
          }}
        />
        <p
          style={{
            fontWeight: "bold",
          }}
        >
          DA
        </p>
        <input
          style={{
            border: "1px solid grey",
            padding: "5px",
            borderRadius: "5px",
            marginBottom: "5px",
            width: "100%",
          }}
        />
        <p
          style={{
            fontWeight: "bold",
          }}
        >
          DR
        </p>
        <input
          style={{
            border: "1px solid grey",
            padding: "5px",
            borderRadius: "5px",
            marginBottom: "5px",
            width: "100%",
          }}
        />
      </div>
      <div style={{ display: "grid", gridTemplateColumns: "100%" }}>
        <div style={{}}>
          <div style={{ width: "100%" }}>
            <p style={{ fontWeight: "bold" }}>URL:</p>
            <input
              style={{
                border: "1px solid grey",
                padding: "5px",
                borderRadius: "5px",
                marginBottom: "5px",
                width: "100%",
              }}
            />
          </div>
          <div style={{ width: "100%" }}>
            <p style={{ fontWeight: "bold" }}>Quality</p>
            <input
              style={{
                border: "1px solid grey",
                padding: "5px",
                borderRadius: "5px",
                marginBottom: "5px",
                width: "100%",
              }}
            />
          </div>
        </div>
      </div>
      <div style={{}}>
        <p style={{ fontWeight: "bold" }}>Link Samples</p>
        <div>
          <input
            style={{
              border: "1px solid grey",
              padding: "5px",
              borderRadius: "5px",
              marginBottom: "5px",
              width: "100%",
            }}
          />
          <input
            style={{
              border: "1px solid grey",
              padding: "5px",
              borderRadius: "5px",
              marginBottom: "5px",
              width: "100%",
            }}
          />
          <input
            style={{
              border: "1px solid grey",
              padding: "5px",
              borderRadius: "5px",
              marginBottom: "5px",
              width: "100%",
            }}
          />
          <input
            style={{
              border: "1px solid grey",
              padding: "5px",
              borderRadius: "5px",
              marginBottom: "5px",
              width: "100%",
            }}
          />
          <input
            style={{
              border: "1px solid grey",
              padding: "5px",
              borderRadius: "5px",
              marginBottom: "5px",
              width: "100%",
            }}
          />
          <input
            style={{
              border: "1px solid grey",
              padding: "5px",
              borderRadius: "5px",
              marginBottom: "5px",
              width: "100%",
            }}
          />
          <input
            style={{
              border: "1px solid grey",
              padding: "5px",
              borderRadius: "5px",
              marginBottom: "5px",
              width: "100%",
            }}
          />
          <input
            style={{
              border: "1px solid grey",
              padding: "5px",
              borderRadius: "5px",
              marginBottom: "5px",
              width: "100%",
            }}
          />
          <input
            style={{
              border: "1px solid grey",
              padding: "5px",
              borderRadius: "5px",
              marginBottom: "5px",
              width: "100%",
            }}
          />
          <input
            style={{
              border: "1px solid grey",
              padding: "5px",
              borderRadius: "5px",
              marginBottom: "5px",
              width: "100%",
            }}
          />
        </div>
      </div>
      <div>
        <p style={{ fontWeight: "bold" }}>Domain Comments</p>
        <input
          style={{
            border: "1px solid grey",
            padding: "5px",
            borderRadius: "5px",
            marginBottom: "5px",
            width: "100%",
          }}
        />
      </div>
      <div
        style={{
          display: "flex",
          justifyContent: "space-evenly",
          alignItems: "center",
        }}
      >
        <div>
          <p style={{ fontWeight: "bold" }}>Link Type</p>
          <input
          style={{
            border: "1px solid grey",
            padding: "5px",
            borderRadius: "5px",
